window.bookSummaryJSON = "<p>After surviving a disastrous battle at prom, Alyssa has embraced her madness and gained perspective. She's determined to rescue her two worlds and the people and netherlings she loves, even if it means challenging Queen Red to a final battle of wills and wiles... and even if the only way to Wonderland, now that the rabbit hole is closed, is through the looking-glass world - a parallel dimension filled with mutated and violent netherling outcasts. </p> <p>In the final installment of the wildly popular Splintered trilogy, Alyssa and her dad journey into the heart of magic and mayhem in search of her mom and to set right all that's gone wrong. Together with Jeb and Morpheus, they must salvage Wonderland from the decay and destruction that has ensnared it. But if they succeed and come out alive, can everyone truly have their happily ever after?</p>"; 
